function makeTable(t){let e=totalCount(t),n="<table><thead><tr><th>Location</th><th>Total</th><th>Percent</th></tr></thead><tbody id='locationTotal'>";$("#affectedPeopleNumber").text(e);for(let o=0;o<t.length;o++){let a=t[o][1];n+="<tr><td>"+t[o][0]+"</td><td>"+a+"</td><td>"+(a/e*100).toFixed(2).concat("%")+"</td></tr>"}n+="</tbody></table>",$("#dhakaCityInfo").html(n)}function totalCount(t){let e=0;for(let n=0;n<t.length;n++)e+=parseInt(t[n][1]);return e}$(function(){$.get("https://teamtigers.github.io/covid19-dataset-bd/dhakacity/dhakacity.json",function(){}).done(function(t){let e=Object.entries(t);$("#affectedAreaNumber").text(e.length),makeTable(e),$("#accending").click(function(){e.sort(function(t,e){return t[1]-e[1]}),$("#dhakaCityInfo").html(makeTable(e))}),$("#decending").click(function(){e.sort(function(t,e){return e[1]-t[1]}),$("#dhakaCityInfo").html(makeTable(e))})}).fail(function(){showToast("Something went wrong!")})});